import React, { useState } from 'react';

const TrackReport = () => {
  const [referenceId, setReferenceId] = useState('');
  const [report, setReport] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleTrack = (e) => {
    e.preventDefault();
    if (!referenceId) return;
    
    setLoading(true);
    
    // Simulate API call
    setTimeout(() => {
      setReport({
        referenceId: referenceId,
        problemType: 'Litter/Garbage',
        description: 'Garbage bin overflowing near playground',
        status: 'In Progress',
        submittedDate: '2024-01-15',
        lastUpdated: '2024-01-16',
        estimatedResolution: '2024-01-18'
      });
      setLoading(false);
    }, 1000);
  };

  const getStatusInfo = (status) => {
    const statuses = {
      'Submitted': { color: 'warning', icon: 'üìù' },
      'In Progress': { color: 'info', icon: '‚öôÔ∏è' },
      'Resolved': { color: 'success', icon: '‚úÖ' }
    };
    return statuses[status] || { color: 'secondary', icon: '‚ùì' };
  };

  return (
    <div className="container mt-4">
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card shadow">
            <div className="card-header bg-info text-white">
              <h4 className="mb-0">Track Your Report</h4>
            </div>
            <div className="card-body">
              <form onSubmit={handleTrack} className="mb-4">
                <div className="input-group">
                  <input
                    type="text"
                    className="form-control form-control-lg"
                    placeholder="Enter your Reference ID (e.g., CMP-20240115-ABC123)"
                    value={referenceId}
                    onChange={(e) => setReferenceId(e.target.value)}
                  />
                  <button 
                    type="submit" 
                    className="btn btn-primary btn-lg"
                    disabled={loading || !referenceId}
                  >
                    {loading ? 'Tracking...' : 'Track'}
                  </button>
                </div>
                <small className="text-muted">
                  Find your Reference ID in the confirmation email or message
                </small>
              </form>
              
              {report && (
                <div className="tracking-results">
                  <h5>Report Status</h5>
                  
                  <div className="card mb-3">
                    <div className="card-body">
                      <div className="d-flex justify-content-between align-items-center mb-3">
                        <div>
                          <h6>Reference ID</h6>
                          <h4><code>{report.referenceId}</code></h4>
                        </div>
                        <div className={`badge bg-${getStatusInfo(report.status).color} p-3`}>
                          <h5 className="mb-0">{getStatusInfo(report.status).icon} {report.status}</h5>
                        </div>
                      </div>
                      
                      <div className="row">
                        <div className="col-md-6">
                          <p><strong>Problem Type:</strong> {report.problemType}</p>
                          <p><strong>Description:</strong> {report.description}</p>
                        </div>
                        <div className="col-md-6">
                          <p><strong>Submitted:</strong> {report.submittedDate}</p>
                          <p><strong>Last Updated:</strong> {report.lastUpdated}</p>
                          <p><strong>Estimated Resolution:</strong> {report.estimatedResolution}</p>
                        </div>
                      </div>
                      
                      {/* Status Timeline */}
                      <div className="mt-4">
                        <h6>Status Timeline</h6>
                        <div className="timeline">
                          <div className="timeline-step">
                            <div className="timeline-step-circle bg-success">‚úì</div>
                            <div className="timeline-step-content">
                              <small>Submitted</small>
                              <p>{report.submittedDate}</p>
                            </div>
                          </div>
                          <div className="timeline-step">
                            <div className={`timeline-step-circle bg-${report.status === 'In Progress' ? 'primary' : 'secondary'}`}>
                              {report.status === 'In Progress' ? '‚Ä¢' : ''}
                            </div>
                            <div className="timeline-step-content">
                              <small>In Progress</small>
                              <p>{report.lastUpdated}</p>
                            </div>
                          </div>
                          <div className="timeline-step">
                            <div className="timeline-step-circle bg-secondary">
                              {report.status === 'Resolved' ? '‚úì' : ''}
                            </div>
                            <div className="timeline-step-content">
                              <small>Resolved</small>
                              <p>{report.estimatedResolution}</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              )}
              
              <div className="mt-4">
                <h6>Need Help?</h6>
                <ul>
                  <li>Check your email for the Reference ID</li>
                  <li>Contact park authorities if you can't find your ID</li>
                  <li>Reference IDs are case-sensitive</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TrackReport;
